            "metatags": [
             {
              "og:title": "Anytime, Anywhere, Anything: The Effect of Mobile on the Web in 25 Years",
              "og:type": "article",
              "og:url": "https://www.digitalgov.gov/2014/03/13/anytime-anywhere-anything-the-effect-of-mobile-on-the-web-in-25-years/",
              "og:image": "https://www.digitalgov.gov/files/2014/03/featured-web-future-166678934-301-x-212.jpg",
              "og:image:width": "600",
              "og:site_name": "DigitalGov",
              "fb:admins": "100000569454928",
              "og:description": "In 25 years, imagine a world where anytime, anywhere, any device is just taken for granted. That’s the theme from the responses we got from our Mobile Gov Community of Practice members when we asked them to predict the effect mobile would have on the Web over the next 25 years. While no one claimed to have the exact answer, most members described a future state where the Web was pervasive, not just tied to your computer or smartphone, but interacting with anything and everything. “It will be the Internet of Things, plus much more,” said Lawrence Charters, Internet Projects Manager, National Ocean Service, part of the National Oceanic and Atmospheric Administration. Many community members spoke of scannable, wearable, drivable and flyable devices in private sector development or ones that they currently owned (mostly fitness app related). But Dina Li, an IT Specialist from the USDA Economic Research Service, offered a good illustration of what Charters' “plus much more” might entail:",
              "article:publisher": "https://www.facebook.com/digitalgov",
              "article:published_time": "2014-03-13T14:32:42Z",
              "article:modified_time": "2015-06-22T23:57:37Z",
              "twitter:card": "summary_large_image",
              "twitter:site": "@Digital_Gov",
              "twitter:creator": "@jakegab",
              "twitter:domain": "digitalgov.gov",
              "twitter:title": "Anytime, Anywhere, Anything: The Effect of Mobile on the Web in 25 Years",
              "twitter:description": "In 25 years, imagine a world where anytime, anywhere, any device is just taken for granted. That’s the theme from the responses we got from our Mobile Gov Community of Practice members when we asked them to predict the effect mobile would have on the Web over the next 25 years. While no one claimed to have the exact answer, most members described a future state where the Web was pervasive, not just tied to your computer or smartphone, but interacting with anything and everything. “It will be the Internet of Things, plus much more,” said Lawrence Charters, Internet Projects Manager, National Ocean Service, part of the National Oceanic and Atmospheric Administration. Many community members spoke of scannable, wearable, drivable and flyable devices in private sector development or ones that they currently owned (mostly fitness app related). But Dina Li, an IT Specialist from the USDA Economic Research Service, offered a good illustration of what Charters' “plus much more” might entail:",
              "twitter:image": "https://www.digitalgov.gov/files/2014/03/featured-web-future-166678934-301-x-212.jpg",
